import React  from 'react';
import Item from './Item'

export default function Lista({items, setItems})
{
	return(
		<div className="item-container">
			<ul className="lista">
			{items.map(item => (
				<Item 
				key={item.id} 
				text={item.text}
				items={items}
				item={item}
				setItems={setItems}
				/>
			))}
			</ul>
		</div>
	)
}
